/****************************************
 * FFT Microthreaded version
 ****************************************/

// Input: $R10 = M
_main:
	lda   $R0,  LOWORD(X)($R31);
	ldah  $R0,  HIWORD(X)($R0);				// $R0 = X
	// lda   $R10, LOWORD(M)($R31);
	// ldah  $R10, HIWORD(M)($R10);			// $R10 = M

//
// Fast Fourier Transform.
//
// void FFT(complex X[], int M);
//
// $R0  = X
// $R10 = M = log2(array size);
//
MAX_N      = 1 << 16;
BLOCK_POST = 32;

_FFT:
	bis   $R31,   1, $R3;	// $R3 = 1
	sll   $R3, $R10, $R9;	// $R9 = N
	subq  $R9,    2, $R5;	// $R5 = N - 2	(doubles as token)
	
	// Calculate block size
	/*
	 * srl $R9, 1, $R5;
	 * itoft $R5, $F0;			// $F0 = N / 2
	 * cvtqt $F0, $F0;
	 * getinvprocs $F1;			// $F1 = 1 / #procs
	 * mult $F0, $F1, $F0;		// $F0 = (N / 2) / #procs
	 * cvttq $F0, $F2;
	 * ftoit $F2, $R5;			// $R5 = Block size
	 */
	
//******************************************************
//  Comment this out if you don't want the bit reversal.
//
	allocate $R7;
	addq     $R0,  16, $R8;
	setstart $R7, $R8;		// start = &X[1]
	sll      $R5,   4, $R8;
	addq	 $R8, $R0, $R8;
	setlimit $R7, $R8;		// limit = &X[N - 2]
	setstep  $R7, 16;		// step  = 16
	setblock $R7, BLOCK_POST;
	
	srl $R9,   1, $R1;	// $R1 = N / 2
	bis $R1, $R1, $R2;	// $R2 = j = N / 2
	cred $R7, _FFT_POST;

	// sync
	bis $R31, $R7, $R31; swch;
//
//
//******************************************************/

	allocate $R7;

	lda  $R4, LOWORD(MAX_N)($R31);
	ldah $R4, HIWORD(MAX_N)($R4);	// $R4 = MAX_N

	setstart $R7, $R3;		// start = 1
	setlimit $R7, $R10;		// limit = M
	setplace $R7, $R31;		// place = LOCAL

	lda  $R2, LOWORD(_cos_sin)($R31);
	ldah $R2, HIWORD(_cos_sin)($R2);	// $R2 = _cos_sin
	sll  $R5,   3, $R1;					// $R1 = (N / 2 - 1) * 16;

	// create and sync
	cred $R7, _FFT_1;
	bis $R31, $R7, $R31;
	end;
//
// END FFT
//	    

//***************************
//
// for (i = 0; i < N - 1; i++) {
//
// $GR0 = X
// $GR1 = N / 2
// $SR0 = j
// $LR0 = &X[i]
//
.align 64;
_FFT_POST:
	.registers 2 1 7  0 0 0;	// GR,SR,LR, GF,SF,LF
	
	allocate $LR3;
								// $LR0 = &X[i]
	bis $DR0, $DR0, $LR1; swch;	// $LR1 = j
	bis $GR0, $GR0, $LR2;		// $LR2 = X
	cred $LR3, _FFT_POST_SWAP;
	
    // k = N / 2;
    bis $GR1, $GR1, $LR4;		// $LR4 = k
    bis $LR1, $LR1, $LR5;		// $LR5 = j
    
    // while (k <= j) {
    br $R31, _FFT_POST_2E;
    _FFT_POST_2S:
    	// j = j - k;
    	subq $LR5, $LR4, $LR5;
    	
    	// k = k / 2;
    	srl $LR4, 1, $LR4;
    //
    // }
    _FFT_POST_2E:
    subq $LR4, $LR5, $LR6;
    ble $LR6, _FFT_POST_2S; swch;
    
    // j = j + k;
    addq $LR5, $LR4, $SR0;
    
    // sync
    bis $R31, $LR3, $R31;
	end;

//
// $GR0 = &X[i];
// $GR1 = j
// $GR2 = X
//
.align 64;
_FFT_POST_SWAP:
	.registers 3 0 2  0 0 4;
	sll  $GR1,    4, $LR0;
	addq $LR0, $GR2, $LR0;	// $LR0 = &X[j]
	
	// if (i < j) {
	subq $GR0, $LR0, $LR1;
	blt $LR1, _FFT_POST_SWAP_1;
	end;

_FFT_POST_SWAP_1:
	// Swap X[i] and X[j]
	debug $GR0;
	debug $LR0;
    ldt $LF0, 0($GR0);
    ldt $LF1, 8($GR0);
    ldt $LF2, 0($LR0);
    ldt $LF3, 8($LR0);
    //cpys $LF1, $LF1, $F31; swch;
    //cpys $LF2, $LF2, $F31; swch;
    //cpys $LF3, $LF3, $F31; swch;
    stt $LF0, 0($LR0); swch;
    stt $LF1, 8($LR0); swch;
    stt $LF2, 0($GR0); swch;
    stt $LF3, 8($GR0);
	end;
//	***************************/

//
// for (int k = 1; k <= M; k++) {
//
// $GR0 = X
// $GR1 = (N / 2 - 1) * 16
// $GR2 = _cos_sin
// $GR3 = 1
// $GR4 = MAX_N
// $SR0 = token
// $LR0 = k
//
.align 64;
_FFT_1:
	.registers 5 1 6  0 0 0;	// GR,SR,LR, GF,SF,LF
	
	allocate $LR5;				// start = 0
	setlimit $LR5, $GR1;		// limit = (N / 2 - 1) * 16
	setstep  $LR5, 16;			// step  = 16
	//setblock $LR5, $GR5;
	
	srl  $GR4, $LR0, $LR4;		// $LR4 = Z = (MAX_N >> k);
    bis  $GR0, $GR0, $LR3;		// $LR3 = X
    bis  $GR2, $GR2, $LR2;		// $LR2 = _cos_sin
	subq $LR0,    1, $LR1;		// $LR1 = k - 1;
	sll  $GR3, $LR0, $LR0;
	sll  $LR0,    3, $LR0;
	subq $LR0,    1, $LR0;		// $LR0 = LE2 * 16 - 1
	
    bis  $R31, $DR0, $R31; swch;// wait for token
	cred $LR5, _FFT_2;
	bis  $LR5, $LR5, $SR0; 		// sync and write token
	end;

//	
// for (i = 0; i < N / 2; i++) {
//
// $GR0 = LE2 * 16 - 1
// $GR1 = k - 1
// $GR2 = _cos_sin
// $GR3 = X
// $GR4 = Z
// $LR0 = i * 16
//
.align 64;
_FFT_2:
	.registers 5 0 3  0 0 8;	// GR,SR,LR, GF,SF,LF
	
	and  $LR0, $GR0, $LR1;	// $LR1 = w
	subq $LR0, $LR1, $LR0;
	sll  $LR0,    1, $LR0;
	addq $LR0, $LR1, $LR0;	// $LR0 = j
	
	addq $LR0, $GR0, $LR2;  // $LR2 = ip;
	addq $LR2, $GR3, $LR2;	// $LR2 = &X[ip] - 1;
	ldt $LF2, 1($LR2);
	ldt $LF3, 9($LR2);		// $LF2, $LF3 = X[ip]
	
	mulq $LR1, $GR4, $LR1;
	addq $LR1, $GR2, $LR1;	// $LR1 = &_cos_sin[w * Z];
	ldt $LF4, 0($LR1);
	ldt $LF5, 8($LR1);		// $LF4, $LF5 = U
				
	addq $LR0, $GR3, $LR0;	// $LR0 = &X[j];
	ldt $LF0, 0($LR0);
	ldt $LF1, 8($LR0);		// $LF0, $LF1 = X[j]
	
	// complex T = U * X[ip];
	mult $LF4, $LF2, $LF6; swch;
	mult $LF5, $LF3, $LF7; swch;
	mult $LF5, $LF2, $LF2;
	mult $LF4, $LF3, $LF3;
	subt $LF6, $LF7, $LF6; swch;
	addt $LF2, $LF3, $LF7; swch;	// $LF6, $LF7 = T
	
	// X[ip] = X[j] - T
	// X[j]  = X[j] + T
	subt $LF0, $LF6, $LF2; swch;
	addt $LF0, $LF6, $LF0;
	subt $LF1, $LF7, $LF3; swch;
	addt $LF1, $LF7, $LF1;
	
	stt $LF2, 1($LR2); swch;
	stt $LF3, 9($LR2); swch;
	stt $LF0, 0($LR0); swch;
	stt $LF1, 8($LR0);
	end;
	    
/****************************************
 * Sine/Cosine lookup table
 ****************************************/
/* This table stores pairs of
 * {
 *    cos(2 * i * PI / MAX_N),
 *   -sin(2 * i * PI / MAX_N)
 * }
 * that are used in the FFT calculation
 ****************************************/
 PI = 3.1415926535897932384626433832795;
 
.align 64;
_cos_sin:
    double =  cos(2 *     0 * PI / MAX_N);
